async function ({ipAddress}, {location}, {externalContext}) {
  try {
    const response = await fetch(`https://api.ipgeolocation.io/ipgeo?apiKey=${externalContext.apiKey}&ip=${ipAddress}`);
    const data = await response.json();
    location.next(data.city);
  } catch (error) {
    console.error(error);
  }
}
